                <li><Link to = "/AboutUs">About Us</Link></li>
                <li><Link to = "/Service">Service</Link></li>
                <li><Link to = "/Products">Products</Link></li>
                <li><Link to = "/Contact">Contact Us</Link></li>
            </ul>
        </div>
    )
}
